import React from "react";
import pricingData from "./pricingdata";
import Footer from "./Footer";
import { FaFireAlt, FaCheckCircle } from "react-icons/fa";
import "./PricingPlans.css";

const PricingPlans = () => {
  return (
    <div className="bg-[#0e0e0e] text-white min-h-screen w-full flex flex-col items-center px-6 py-16">
      {/* Hero */}
      <div className="text-center mb-20">
        <h1
          className="text-6xl md:text-7xl font-bold mb-6"
          style={{ fontFamily: "Poppins, sans-serif" }}
        >
          Join Turo
        </h1>
        <img src="/your-logo.png" alt="Join Turo" className="mx-auto w-24" />
      </div>

      {/* Pricing Panels */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-10 w-full max-w-7xl">
        {pricingData.map((plan, index) => (
          <div
            key={index}
            className="bg-gradient-to-br from-[#1a1a1a] to-[#222] p-8 rounded-3xl shadow-2xl flex flex-col justify-between border border-[#2f2f2f]"
          >
            <div>
              <div className="flex items-center gap-3 mb-5">
                <plan.icon className="text-pink-400 text-2xl" />
                <h2 className="text-2xl font-semibold text-white">{plan.title}</h2>
              </div>
              <p className="text-4xl font-bold mb-3">{plan.price}</p>
              <p className="text-gray-400 mb-6 text-sm">{plan.description}</p>
              <div className="border-t border-gray-700 my-6"></div>
              <ul className="space-y-3">
                {plan.features.map((feature, idx) => (
                  <li key={idx} className="flex items-center text-sm text-gray-300">
                    <plan.checkIcon className="text-green-400 mr-2 text-base" />
                    {feature}
                  </li>
                ))}
              </ul>
            </div>
            <button className="mt-10 py-3 bg-gradient-to-r from-[#934cff] to-[#2f7cf8] text-white text-sm font-medium rounded-lg hover:scale-105 transition-transform">
              Get Started
            </button>
          </div>
        ))}
      </div>

      {/* Footer */}
      <div className="mt-24 w-full">
        <Footer />
      </div>
    </div>
  );
};

export default PricingPlans;
